import React, { useState } from "react";
import { useSelector, useDispatch } from "react-redux";
import { useNavigate, useLocation } from "react-router-dom";
import { logout } from "../../redux/slices/authSlice";
import Header from "../Header";
import Footer from "../Footer";
import { useGetBookingsQuery } from "../../redux/api/bookingApi";
// import airplaneIcon from "../../../public/assets/images/icon-airplance-color.png";
// import defaultThumb from "../../assets/images/thumb-learjet45.jpg"; // placeholder image

export default function Dashboard() {
  const { userInfo } = useSelector((state) => state.auth);
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const location = useLocation();

  // Extract booking params from URL (if any)
  const bookingParams = new URLSearchParams(location.search);
  const from = bookingParams.get("from");
  const to = bookingParams.get("to");
  const pax = bookingParams.get("pax");

  const [activeTab, setActiveTab] = useState("pending"); // pending | confirmed | cancelled
  const { data, isLoading } = useGetBookingsQuery();

  const handleLogout = () => {
    dispatch(logout());
    navigate("/");
  };

  if (!userInfo) {
    return (
      <div className="p-5 text-center">
        <h2>Please login to access dashboard</h2>
      </div>
    );
  }

  // Filter bookings by status
  const bookings = data?.bookings || [];
  const filteredBookings = bookings.filter(
    (b) => b.status?.toLowerCase() === activeTab
  );
  console.log("User Bookings:", filteredBookings);

  return (
    <>
      <Header />

      <div className="inner-heading">
        <h1>My Bookings</h1>
      </div>

      <div className="mybookings-container container">
        <div className="mybookings-left">
          <ul>
            {["pending", "confirmed", "cancelled"].map((tab) => (
              <li key={tab}>
                <a
                  href="#"
                  className={activeTab === tab ? "active" : ""}
                  onClick={(e) => {
                    e.preventDefault();
                    setActiveTab(tab);
                  }}
                >
                  {tab.charAt(0).toUpperCase() + tab.slice(1)}
                </a>
              </li>
            ))}
          </ul>
        </div>

        <div className="mybookings-content">
          {/* Filter Bar */}
          <div className="filter">
            <div className="filter-col">
              <label htmlFor="fromdate">From Date</label>
              <input
                type="date"
                name="fromdate"
                className="icondate"
                placeholder="DD/MM/YYYY"
              />
            </div>

            <div className="filter-col">
              <label htmlFor="todate">To Date</label>
              <input
                type="date"
                name="todate"
                className="icondate"
                placeholder="DD/MM/YYYY"
              />
            </div>

            <div className="filter-col-button">
              <label>&nbsp;</label>
              <input type="submit" value="Search" />
            </div>
          </div>

          {/* Bookings List */}
          <div className="mybookings-listing active">
            {isLoading ? (
              <p>Loading bookings...</p>
            ) : filteredBookings.length > 0 ? (
              filteredBookings.map(
                (booking) => (
                  console.log(
                    "BookingImage:",
                    booking?.flightType?.images?.[0]?.url
                  ),
                  (
                    <div className="mybookings-col" key={booking._id}>
                      <div className="thumb">
                        <img
                          src={booking?.flightType?.images?.[0]?.url || ""}
                          alt="Flight"
                        />
                      </div>
                      <div className="content">
                        <h2>
                          {booking.fromPlace}{" "}
                          <div className="icon">
                            <img src="" alt="Airplane" />
                          </div>{" "}
                          {booking.toPlace}{" "}
                          <span
                            className={`status ${
                              booking.status === "confirmed"
                                ? "status-success"
                                : booking.status === "cancelled"
                                ? "status-danger"
                                : "status-warning"
                            }`}
                          >
                            {booking.status}
                          </span>
                        </h2>
                        <p>
                          <strong>Booking ID</strong> - {booking._id.slice(-6)}
                        </p>
                        <p>
                          <strong>Booking Date</strong> -{" "}
                          {new Date(booking.travelDate).toLocaleDateString()} at{" "}
                          {booking.travelTime}
                        </p>
                      </div>
                    </div>
                  )
                )
              )
            ) : (
              <p>No {activeTab} bookings found.</p>
            )}
          </div>
        </div>
      </div>

      <div className="text-center mt-4">
        <button onClick={handleLogout} className="btn btn-outline-danger">
          Logout
        </button>
      </div>

      <Footer />
    </>
  );
}
